<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8" />
  <meta name="renderer" content="webkit">
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
  <meta name="format-detection" content="telephone=no,email=no,address=no">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <link rel="icon" href="/favicon.ico" type="image/x-icon" />
  <link rel="shortcut icon" href="/favicon.ico" type="image/x-icon" />
  <title>商米商用路由</title>
  <script>
    (function(){"http:"===location.protocol&&"localhost"!==location.hostname&&(location.href=location.href.replace("http:","https:"))})();
    (function(){var engine={ie:0,ver:null};var ua=navigator.userAgent;if(/MSIE ([^;]+)/i.test(ua)){engine.ver=RegExp["$1"];engine.ie=parseFloat(engine.ver,10);if(engine.ie<10){alert("请使用IE10及以上版本的浏览器访问！")}}})();
  </script>
</head>
<body>
  <div id="wrap" class="layout">
  </div>
</body>
</html>
